public static org.sonar.api.notifications.NotificationDispatcherMetadata newMetadata() {
    return org.sonar.api.notifications.NotificationDispatcherMetadata.create(com.cruson.review.NewIssuesNotificationDispatcher.KEY).setProperty(NotificationDispatcherMetadata.GLOBAL_NOTIFICATION, java.lang.String.valueOf(true)).setProperty(NotificationDispatcherMetadata.PER_PROJECT_NOTIFICATION, java.lang.String.valueOf(true));
}